  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0117073 includes chemical,
  meteorological, physical and time series data collected from TAO165E8S and TAO165E_8S
  in the South Pacific Ocean from 2009-06-22 to 2011-11-15. These data include AIR-SEA
  DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE,
  OXYGEN - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide -
  atmosphere, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include Bubble
  type equilibrator for autonomous carbon dioxide (CO2) measurement and Carbon dioxide
  (CO2) gas analyzer.nnThese data were collected by Adrienne Sutton, Christopher Sabine,
  Stacy Maenner and Sylvia Musielewicz of US DOC; NOAA; OAR; Pacific Marine Environmental
  Laboratory as part of the Mooring_TAO165E8S_Jun2009_Sep2010 and Mooring_TAO165E8S_Oct2010_Nov2011
  data set. CDIAC associated the following cruise ID(s) with this data set: T16820090622
  and T16820101018nnThe Global CO2 Time-series and Moorings Project involves international
  groups from 18 countries who have mounted sensors on moored buoys to provide high
  resolution time-series measurements of atmospheric boundary layer and surface ocean
  CO2 partial pressure (pCO2). The CO2 Time-series and Moorings Project is coordinated
  by UNESCO International Ocean Carbon Coordination Project (IOCCP).\",\n\t\"owner_org\":
